import styled from 'styled-components';

const Equi = styled.div`
background: black;
border-radius: 50%;
width: 1080px;
height: 1080px;
border: 5px solid white;
margin-top: 120px;
position: absolute;
display: flex;
justify-content: center;
`
export const CablesArea = styled.div`
height: 370px;
width: 100px;
background: white;
`
export const Potentiometer = styled.div`
background: white;
border-radius: 50%;
width: 400px;
height: 400px;
margin-top: 340px;
position: absolute;
`

export default Equi;
